import React , { Component } from 'react';
import Card from './Component/Cards'
import Modal from './Component/Modals'
import './App.css';
import axios from "axios";

 class App extends Component {
  constructor(props){ 
    super(props) 
    this.state = {
        dataFetch : [] ,
       }
    }

    componentDidMount(){
      axios
      .get("http://localhost:3000/products")
      .then(response => {
      this.setState({
        dataFetch : response.data
        })
      })
      .catch(error => console.log(error));
    }

    addNew = () => {
      console.log('add car');
      const newCards = [...this.state.dataFetch];
      this.setState({
        dataFetch : newCards
      })
    }

  render() {
    console.log(this.state.dataFetch , 'mon state');
    const CardList = this.state.dataFetch.map((data , i ) => {
      return (
      <Card key = {i}
        available = {data.available}
        name = {data.name}
        price = {data.price}
        rating = {data.rating}
        type = {data.type}
        years = {data.warranty_years}
      />
    )
    })
    return(
      <div className='app'>
        {CardList}
        <Modals/>
      </div>
    )
  }
}

export default App
